import './styles/Login.css';

function CreateUser() {
    var user = {
        email:document.getElementsByClassName("email-field").value(),
        password:null,
        name:null,
        lastname:null,
        documentation:null
    }
}

function Register() {

    



    return (
        <div>
            <form className="register-form">
                <input className="email-field" placeholder="Email" type="email"></input>
                <input className="password-field" placeholder="ContraseÃ±a" type="password"></input>
                <input className="name-field" placeholder="Nombre"></input>
                <input className="lastname-field" placeholder="Apellido"></input>
                <input className="documentation-field" placeholder="DNI"></input>
                <button onClick={CreateUser()}>Crear Cuenta</button>
            </form>
        </div>
    )
}

export default Register;
